import React from "react";

const Contact = () => {
  return (
    <div className="h-screen flex justify-center items-center text-center bg-green-300">
      <h1 className="lg:text-6xl md:text-5xl sm:text-4xl text-3xl font-light px-5">
        I'm a <span className="font-medium">Frontend Developer</span> 22 Years old.
      </h1>
    </div>
  );
};

export default Contact;
